import React, { useEffect, useState } from 'react'



function EventDetail(){

    const [_eventId, setEventId] = useState<number>(0)

    useEffect(() => {
        setEventId(eventId)
        return () => {
            console.log('terminate')
        }
    }, [])

    return(
        <div>
            Detail, {_eventId}
        </div>
    )
}

export default EventDetail
